import React,{Component} from "react";

import DataWeather from '../data-weather/data-weather';

import './app.css';

class App extends React.Component {

	render() {
    	return (
			<div>
				<div className="wrapper">
					<div className="main">
						<div className="container">
							<div className="row">
								<DataWeather />

							</div>
						</div>
					</div>
				</div>
			</div>
   		);
  	}
};

export default App;
